const API_URL = 'http://localhost:8000';

export function httpGetContent() {
    fetch(`http://localhost:8000`, {
        method:'GET',
    })
    .then((res)=>res.json())
    .catch((err)=>console.log(err))
    .then((data)=>console.log(data))
}
